import { connect } from 'react-redux'
function Accounts() {
  return (
    <div className="card">
      {this.state.accounts.map((acc) => (
        <li key={acc.id}>
          {acc.name} - {acc.email}
        </li>
      ))}
    </div>
  );
}
  const mapStateToProps = (state) => {
    return {
      accounts: state.accounts,
    };
  };


export default connect(mapStateToProps, null)(Accounts);
